import React from 'react';

import './custom-button.scss';

const CustomButton = ({
	inverted,
	children,
	isGoogleSignIn,
	...otherProps
}) => (
	<button
		className={`${inverted ? 'inverted' : ''} custom-button`}
		{...otherProps}
	>
		{children}
	</button>
);
export default CustomButton;
